# Raw data from user input\nraw_data = {"name": "John", "age": "twenty-five"}\n\n# Data massage (convert age to integer)\nmassaged_data = {"name": raw_data["name"], "age": int(raw_data["age"].replace("twenty-", "25"))}\n\n# Send massaged data to SQL database\nimport sqlite3\nconn = sqlite3.connect("example.db")\ncursor = conn.cursor()\ncursor.execute("INSERT INTO users (name, age) VALUES (?, ?)", (massaged_data["name"], massaged_data["age"]))\nconn.commit()